import subprocess
import re
import json

# Extract from line 2293916 which had 59 readable metrics (female_black)
result = subprocess.run(['sed', '-n', '2293916p', '/Users/imorgado/Desktop/FACEIQPAID/FACEIQ-RACE&GENDER.har'], capture_output=True, text=True)
content = result.stdout

# Try more flexible patterns to capture all metrics
pattern = r'\\"name\\":\\"([^"\\]+)\\"[^{}]*?\\"idealMin\\":([0-9.]+)[^{}]*?\\"idealMax\\":([0-9.]+)'
matches = re.findall(pattern, content)

black_metrics = {}
for name, idealMin, idealMax in matches:
    if not any(ord(c) > 127 for c in name) and len(name) > 2:
        if name not in black_metrics:
            black_metrics[name] = {
                'idealMin': float(idealMin),
                'idealMax': float(idealMax)
            }

print(f"Extracted {len(black_metrics)} readable metrics from female_black data")

# Extract from line 1822796 (female_east_asian)
result2 = subprocess.run(['sed', '-n', '1822796p', '/Users/imorgado/Desktop/FACEIQPAID/FACEIQ-RACE&GENDER.har'], capture_output=True, text=True)
content2 = result2.stdout

asian_metrics = {}
matches2 = re.findall(pattern, content2)
for name, idealMin, idealMax in matches2:
    if not any(ord(c) > 127 for c in name) and len(name) > 2:
        if name not in asian_metrics:
            asian_metrics[name] = {
                'idealMin': float(idealMin),
                'idealMax': float(idealMax)
            }

print(f"Extracted {len(asian_metrics)} readable metrics from female_east_asian data")

# Combine - prioritize asian metrics, fill in with black where available
combined_metrics = dict(asian_metrics)
for name, vals in black_metrics.items():
    if name not in combined_metrics:
        combined_metrics[name] = vals

print(f"\nCombined: {len(combined_metrics)} unique readable metrics")

# Print all metrics 
print("\n=== All Metrics ===")
for name in sorted(combined_metrics.keys()):
    vals = combined_metrics[name]
    source = "East Asian" if name in asian_metrics else "Black (fallback)"
    print(f"{name}: {vals['idealMin']} - {vals['idealMax']} [{source}]")

# Create output with detailed info about what comes from where
output_metrics = {}
for name in sorted(combined_metrics.keys()):
    if name in asian_metrics:
        output_metrics[name] = {
            'idealMin': asian_metrics[name]['idealMin'],
            'idealMax': asian_metrics[name]['idealMax'],
            'source': 'east_asian'
        }
        if name in black_metrics and (black_metrics[name]['idealMin'] != asian_metrics[name]['idealMin'] or 
                                       black_metrics[name]['idealMax'] != asian_metrics[name]['idealMax']):
            output_metrics[name]['black_comparison'] = {
                'idealMin': black_metrics[name]['idealMin'],
                'idealMax': black_metrics[name]['idealMax']
            }
    else:
        output_metrics[name] = {
            'idealMin': black_metrics[name]['idealMin'],
            'idealMax': black_metrics[name]['idealMax'],
            'source': 'black_reference',
            'note': 'No East Asian data available - using Black reference'
        }

# Final output
output = {
    "gender": "male",
    "ethnicity": "asian",
    "extraction_date": "2025-12-20",
    "source": "FaceIQ Labs Beta HAR file",
    "important_notes": [
        "The HAR file contained female_east_asian and female_black unlocked analyses, but no male_east_asian unlocked data.",
        "Male ideal ranges typically differ from female (e.g., lower gonial angle, more pronounced brow ridge, wider jaw).",
        "These female East Asian ranges are provided as a reference. For accurate male Asian ideals, FaceIQ would need to provide male-specific data.",
        "Metrics marked with source='black_reference' had no East Asian data and use Black reference values instead."
    ],
    "metrics": output_metrics
}

with open('/tmp/faceiq_male_asian.json', 'w') as f:
    json.dump(output, f, indent=2)

print(f"\n\nSaved to /tmp/faceiq_male_asian.json with {len(output_metrics)} metrics")
